import './App.css';
import {Container} from 'react-bootstrap'
import Header from './Components/Header';
import Footer from './Components/Footer';
import Home from './Components/Body/Home';


function App() {
  return (
    <div>
      <Header />
      <main>
        <Container>
          <Home />                  
        </Container>    
      </main>
      <Footer />
    </div>
  );
}

export default App;
